/*Table structure for table `leave` */

DROP TABLE IF EXISTS `leave`;

CREATE TABLE `leave` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `appr_num` varchar(32) DEFAULT NULL COMMENT '审批编号',
  `title` varchar(32) DEFAULT NULL COMMENT '标题',
  `status` varchar(32) DEFAULT NULL COMMENT '审批状态',
  `result` varchar(32) DEFAULT NULL COMMENT '审批结果',
  `start_time` datetime DEFAULT NULL COMMENT '审批发起时间',
  `end_time` datetime DEFAULT NULL COMMENT '审批完成时间',
  `people_num` varchar(32) DEFAULT NULL COMMENT '发起人工号',
  `people_name` varchar(32) DEFAULT NULL COMMENT '发起人姓名',
  `department` varchar(32) DEFAULT NULL COMMENT '发起人部门',
  `history_appr` varchar(32) DEFAULT NULL COMMENT '历史审批人姓名',
  `appr_record` text COMMENT '审批记录',
  `curr_manager` varchar(32) DEFAULT NULL COMMENT '当前处理人姓名',
  `time_consuming` varchar(32) DEFAULT NULL COMMENT '审批耗时',
  `leave_type` varchar(32) DEFAULT NULL COMMENT '请假类型',
  `start_date` date DEFAULT NULL COMMENT '开始时间',
  `end_date` date DEFAULT NULL COMMENT '结束时间',
  `leave_date` int(11) DEFAULT NULL COMMENT '请假天数(天)',
  `leave_reason` varchar(32) DEFAULT NULL COMMENT '请假事由',
  `img` varchar(32) DEFAULT NULL COMMENT '图片',
  `load_time` datetime DEFAULT NULL COMMENT '导入时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `UNIQUE_appr_num` (`appr_num`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8;

/*Data for the table `leave` */

/*Table structure for table `over_work` */

DROP TABLE IF EXISTS `over_work`;

CREATE TABLE `over_work` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `appr_num` varchar(32) DEFAULT NULL COMMENT '审批编号',
  `title` varchar(32) DEFAULT NULL COMMENT '标题',
  `status` varchar(32) DEFAULT NULL COMMENT '审批状态',
  `result` varchar(32) DEFAULT NULL COMMENT '审批结果',
  `start_time` datetime DEFAULT NULL COMMENT '审批发起时间',
  `end_time` datetime DEFAULT NULL COMMENT '审批完成时间',
  `people_num` varchar(32) DEFAULT NULL COMMENT '发起人工号',
  `people_name` varchar(32) DEFAULT NULL COMMENT '发起人姓名',
  `department` varchar(32) DEFAULT NULL COMMENT '发起人部门',
  `history_appr` varchar(32) DEFAULT NULL COMMENT '历史审批人姓名',
  `appr_record` text COMMENT '审批记录',
  `curr_manager` varchar(32) DEFAULT NULL COMMENT '当前处理人姓名',
  `time_consuming` varchar(32) DEFAULT NULL COMMENT '审批耗时',
  `over_start_time` datetime DEFAULT NULL COMMENT '加班开始时间',
  `over_end_time` datetime DEFAULT NULL COMMENT '加班结束时间',
  `over_hours` double DEFAULT NULL COMMENT '加班时长',
  `is_festival` varchar(32) DEFAULT NULL COMMENT '是否法定节假日',
  `overtime_pay` varchar(32) DEFAULT NULL COMMENT '加班核算方式(是否有加班费)',
  `over_reason` varchar(32) DEFAULT NULL COMMENT '加班原因',
  `load_time` datetime DEFAULT NULL COMMENT '导入时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `UNIQUE_appr_num` (`appr_num`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8;

/*Data for the table `over_work` */

/*Table structure for table `rep_sign` */

DROP TABLE IF EXISTS `rep_sign`;

CREATE TABLE `rep_sign` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `appr_num` varchar(32) DEFAULT NULL COMMENT '审批编号',
  `title` varchar(32) DEFAULT NULL COMMENT '标题',
  `status` varchar(32) DEFAULT NULL COMMENT '审批状态',
  `result` varchar(32) DEFAULT NULL COMMENT '审批结果',
  `start_time` datetime DEFAULT NULL COMMENT '审批发起时间',
  `end_time` datetime DEFAULT NULL COMMENT '审批完成时间',
  `people_num` varchar(32) DEFAULT NULL COMMENT '发起人工号',
  `people_name` varchar(32) DEFAULT NULL COMMENT '发起人姓名',
  `department` varchar(32) DEFAULT NULL COMMENT '发起人部门',
  `history_appr` varchar(32) DEFAULT NULL COMMENT '历史审批人姓名',
  `appr_record` text COMMENT '审批记录',
  `curr_manager` varchar(32) DEFAULT NULL COMMENT '当前处理人姓名',
  `time_consuming` varchar(32) DEFAULT NULL COMMENT '审批耗时',
  `rep_sign_time` datetime DEFAULT NULL COMMENT '补签时间',
  `load_time` datetime DEFAULT NULL COMMENT '导入时间',
  PRIMARY KEY (`id`),
