/*Table structure for table `sign` */

DROP TABLE IF EXISTS `sign`;

CREATE TABLE `sign` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `check_id` varchar(32) DEFAULT NULL COMMENT '考勤号码',
  `staff_id` varchar(32) DEFAULT NULL COMMENT '自定义编号(工号)',
  `staff_name` varchar(32) DEFAULT NULL COMMENT '员工姓名',
  `date` date DEFAULT NULL COMMENT '日期',
  `start_work_time` varchar(32) DEFAULT NULL COMMENT '上班时间 09:00',
  `end_work_time` varchar(32) DEFAULT NULL COMMENT '下班时间 18:00',
  `sign_in_time` varchar(32) DEFAULT NULL COMMENT '签到时间',
  `sign_out_time` varchar(32) DEFAULT NULL COMMENT '签退时间',
  `late_time` varchar(32) DEFAULT NULL COMMENT '迟到时间',
  `early_time` varchar(32) DEFAULT NULL COMMENT '早退时间',
  `is_out_work` varchar(32) DEFAULT NULL COMMENT '是否旷工',
  `department` varchar(32) DEFAULT NULL COMMENT '部门',
  `normal` varchar(32) DEFAULT NULL COMMENT '平时',
  `weekend` varchar(32) DEFAULT NULL COMMENT '周末',
  `festival` varchar(32) DEFAULT NULL COMMENT '节假日',
  `load_time` datetime DEFAULT NULL COMMENT '导入时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `UNIQUE_staff_id_date` (`staff_id`,`date`)
) ENGINE=InnoDB AUTO_INCREMENT=16180 DEFAULT CHARSET=utf8;

