/*Table structure for table `sign_detail` */

DROP TABLE IF EXISTS `sign_detail`;

CREATE TABLE `sign_detail` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `check_id` varchar(32) DEFAULT NULL COMMENT '考勤号',
  `staff_id` varchar(32) DEFAULT NULL COMMENT '自定义编号(工号)',
  `staff_name` varchar(32) DEFAULT NULL COMMENT '员工姓名',
  `check_time` datetime DEFAULT NULL COMMENT '出勤时间',
  `check_status` varchar(32) DEFAULT NULL COMMENT '出勤状态',
  `update_status` varchar(32) DEFAULT NULL COMMENT '更正状态',
  `record_status` varchar(32) DEFAULT NULL COMMENT '异常情况(记录状态)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2983 DEFAULT CHARSET=utf8;

